log:
  level: debug
  proxyLevel: info
database:
  # The database type to use. Supported types are: sqlite3, mysql, postgresql
  type: mysql
  sqlite3:
    path: ximager.db
  mysql:
    host: localhost
    port: 3306
    user: ximager
    password: ximager
    dbname: ximager
  postgresql:
    host: localhost
    port: 5432
    user: ximager
    password: ximager
    dbname: ximager
    sslmode: disable
redis:
  url: redis://:ximager@localhost:6379/0
http:
  server: 0.0.0.0:3000
  worker: 0.0.0.0:3001
storage:
  rootdirectory: ./storage
  type: s3
  filesystem:
    path: /
  s3:
    ak: ximager
    sk: ximager-ximager
    endpoint: http://127.0.0.1:9000
    region: cn-north-1
    bucket: ximager
    forcePathStyle: true
# Notice: the tag never update after the first pulled from remote registry, unless you delete the image and pull again.
proxy:
  enabled: false
  endpoint: https://registry-1.docker.io
  tlsVerify: true
  username: ""
  password: ""
auth:
  internalUser:
    username: internal-ximager
    password: internal-ximager
  admin:
    username: ximager
    password: ximager
  token:
    realm: ""
    service: ""
  jwt:
    ttl: 1h
    refreshTtl: 24h
    privateKey: ""
    publicKey: ""
